import React, { Component } from 'react';
import './Search.css';

class Search extends Component {
    render() { 
        return ( 
            <section className='search'>
                <label className='label'>
                    Pais
                    <select className='input search-pais'>
                        <option>Selecione....</option>
                        <option>Brasil</option>
                        <option>Argentina</option>
                        <option>Estados Unidos</option>
                        <option>Mexico</option>
                    </select> 
                </label>
                <label className='label'>
                    Local
                    <input className='input search-local' type='text' placeholder='Digite o local que deseja conhecer' />
                </label>
                <label className='label'>
                    Meta
                    <input className='input search-data' type='date' />
                </label>
                <button className='' type='submit' >Adicionar</button>
            </section>
         );
    }
}

export default Search;
